import { Card, CardTitle } from "../UI/Card";
import FormInput from "./FormInput";
import FormMessage from "./FormMessage";
import { ContactForm, Button, FormControls } from "./FormStyles";

const formStateArray = [{ name: "", email: "", messenger: "" }];

const Form = () => {
  const nameChangeHandler: () => void = () => {};

  const emailChangeHandler: () => void = () => {};

  const formComponent = (
    <>
      <CardTitle>Contact Form</CardTitle>
      <ContactForm className="form-control">
        <FormInput labelName="Name" min={1} onChange={nameChangeHandler} />
        <FormInput labelName="Email" min={1} onChange={emailChangeHandler} />
        <FormMessage
          labelName="Message"
          rows={5}
          onChange={emailChangeHandler}
        />
        <FormControls>
          <Button>Cancel</Button>
          <Button type="submit">Send</Button>
        </FormControls>
      </ContactForm>
    </>
  );

  return (
    <>
      <section id="contact-form">
        <Card>{formComponent}</Card>
      </section>
    </>
  );
};

export default Form;
